import { useEffect, useState } from 'react';
import './App.css';

function App() {
  let [list, setList] = useState([1, 2, 3, 4]);
  return (
    <div>
      <div>
        {list.map((i) => (
          <h1>{i}</h1>
        ))}
      </div>
    </div>
  );
}

export default App;
